def qgt(R2,epsilon):
    prog=sf.Program(4)
    with prog.context as q:

        #Coherent(r_control,phi_control) | q[0]
        #Coherent(r_target,phi_target) | q[3]

        GKP(gkp_control,epsilon) |q[0]
        GKP(gkp_target,epsilon) |q[3]

        S2gate(R2,PH2) | (q[1],q[2])

        CXgate(s) | (q[0],q[1])
        CXgate(s) | (q[2],q[3])

        MeasureX | q[1]
        MeasureP | q[2]

        Xgate(s*q[1].par) | q[3]
        Zgate(s*q[2].par) | q[0]

    #The string parameter inside sf.Engine selects the backend to run the circuit, and the output state is stored in the variable "state" 
    #result.samples contains the outcomes of both measurments in the order that they are made in the circuit
    eng=sf.Engine('bosonic')
    result=eng.run(prog,modes=[0,3])
    print("Measurement results (in X and P, respectively):" , result.samples)
    state=result.state
    data=state.data

    '''
    #this section imports the weighted linear combination corresponding to the particular epsilon
    if epsilon==0.115:
        weighted_linear_combinations_gaussians=weighted_linear_combinations_gaussians_0_115
    if epsilon==0.120:
        weighted_linear_combinations_gaussians=weighted_linear_combinations_gaussians_0_120
    if epsilon==0.125:
        weighted_linear_combinations_gaussians=weighted_linear_combinations_gaussians_0_125
    '''

    '''
    for parameter in epsilon_parameters:
        if epsilon==parameter:
            weighted_linear_combinations_gaussians=weighted_linear_combinations_gaussians_0_125 #this would be the simplification but idk how to include something like 0.125 at the end of a variable name
    '''

    #a precision is chosen to remove gaussians that won't contribute much to the inner products based on their weight
    precision=1e-100
    number_of_gaussians=len(data[0])

    elements_removed=[]
    for j in range(number_of_gaussians):
        if weighted_linear_combinations_gaussians[2][j]<precision and data[2][j]<precision:
            elements_removed.append(j)

    #indices of elements to remove are removed from original list of gaussians
    remaining_elements=list(range(number_of_gaussians))
    for index in sorted(elements_removed, reverse=True):
        del remaining_elements[index]

    csum_means=[]
    for element in remaining_elements:
        csum_means.append(weighted_linear_combinations_gaussians[0][element])
    csum_covs=[]
    for element in remaining_elements:
        csum_covs.append(weighted_linear_combinations_gaussians[1][element])
    csum_weights=[]
    for element in remaining_elements:
        csum_weights.append(weighted_linear_combinations_gaussians[2][element])

    qgt_means=np.delete(data[0],elements_removed,0)
    qgt_covs=np.delete(data[1],elements_removed,0)
    qgt_weights=np.delete(data[2],elements_removed,0)

    #vectors of means are normalized
    for j in range(len(qgt_means)):
        normalization_factor=np.sqrt(np.dot(np.conjugate(qgt_means[j]),qgt_means[j]))
        if normalization_factor==0:
            normalization_factor=1
        qgt_means[j]=[1/normalization_factor*i for i in qgt_means[j]]

    #covariance matrices are normalized
    for i in range(len(qgt_covs)):
        normalization_factor=np.sqrt(np.dot(np.conjugate(qgt_covs[i][0]),qgt_covs[i][0])+np.dot(np.conjugate(qgt_covs[i][1]),qgt_covs[i][1])+np.dot(np.conjugate(qgt_covs[i][2]),qgt_covs[i][2])+np.dot(np.conjugate(qgt_covs[i][3]),qgt_covs[i][3]))
        qgt_covs[i][0]=[1/normalization_factor*i for i in qgt_covs[i][0]]
        qgt_covs[i][1]=[1/normalization_factor*i for i in qgt_covs[i][1]]
        qgt_covs[i][2]=[1/normalization_factor*i for i in qgt_covs[i][2]]
        qgt_covs[i][3]=[1/normalization_factor*i for i in qgt_covs[i][3]]

    #inner products are evaluated and saved
    means_fidelity=0
    covariance_fidelity=0
    for j in range(len(qgt_means)):
        means_inner_product=np.real(np.dot(np.conjugate(csum_means[j]),qgt_means[j])/len(qgt_means))
        covariance_inner_product=np.real((np.dot(np.conjugate(csum_covs[i][0]),qgt_covs[i][0])+np.dot(np.conjugate(csum_covs[i][1]),qgt_covs[i][1])+np.dot(np.conjugate(csum_covs[i][2]),qgt_covs[i][2])+np.dot(np.conjugate(csum_covs[i][3]),qgt_covs[i][3]))/len(qgt_covs))
        means_fidelity=means_fidelity+means_inner_product
        covariance_fidelity=covariance_fidelity+covariance_inner_product
   
    means_fidelity_results.append(means_fidelity)
    covariance_fidelity_results.append(covariance_fidelity)

    print("vector of means fidelity:",means_fidelity)
    print("covariance matrices fidelity:",covariance_fidelity)

